    //SCENE
    Scene: {
        /*	Attributtes - should be created with lowercase first letter */
        controlPanelDOM: undefined,
        type: "isometric",
        placeholderWidthAnim: [2, 6],
        placeholderWidthAnimAmount: 2, //Substituir por fraccao!*15///(Core.SceneTools.FPSView.fps),
        Utils: {
            PlaceholderWidthAnimAmountCalculated: function () {
                return Core.Scene.placeholderWidthAnimAmount / Core.SceneTools.FPSView.maxFps;
            }
        },
        selectedTiles: [],
        Map: {
            imageMapAboveFloorObj: [],
            canDraw: false,
            Reset: function () {
                try {
                    this.Load('__imaf__');
                } catch (e) {
                    alert('Error attempting to get local storage, reseting');
                    this.imageMapAboveFoorObj = [];
                }
            },
            Save: function () {
                this.SaveAs('__imaf__');
            },
            SaveAs: function (key) {
                if (localStorage)
                    localStorage.setItem(key, JSON.stringify(Core.Scene.Map.imageMapAboveFoorObj));
            },
            Load: function (key, cursor) {
                if (localStorage) {
                    var imaf_temp = localStorage.getItem(key);
                    if (imaf_temp) {
                        this.imageMapAboveFoorObj = JSON.parse(imaf_temp);
                        if (cursor) {
                            //checks the min
                            var _minX = 1000000000;
                            var _minY = 1000000000;
                            for (var i in this.imageMapAboveFoorObj) {
                                if (this.imageMapAboveFoorObj[i][0] < _minX)
                                    _minX = this.imageMapAboveFoorObj[i][0];
                                if (this.imageMapAboveFoorObj[i][1] < _minY)
                                    _minY = this.imageMapAboveFoorObj[i][1];
                            }
                            //resets
                            for (var i in this.imageMapAboveFoorObj) {
                                this.imageMapAboveFoorObj[i][0] = cursor[0] + (this.imageMapAboveFoorObj[i][0] - _minX);
                                this.imageMapAboveFoorObj[i][1] = cursor[1] + (this.imageMapAboveFoorObj[i][1] - _minY);
                            }
                        }
                    }
                    else {
                        this.imageMapAboveFoorObj = [];
                        alert('local resource not found.');
                    }
                }
            },
            Delete: function (cursor) {
                var _positionToRemove = this.CursorFallsInObject(cursor);
                if (_positionToRemove != 0) {
                    _positionToRemove = Core.Scene.Map.imageMapAboveFoorObj.splice(_positionToRemove - 1, 1);
                }
                return _positionToRemove[0];
            },
            DeleteAll: function () {
                Core.Scene.Map.imageMapAboveFoorObj = [];
            },
            DeleteAllAndSave: function () {
                this.DeleteAll();
                this.Save();
            },
            CursorFallsInObject: function (cursor, x, y) {
                if (!x) x = 0;
                if (!y) y = 0;
                for (o in this.imageMapAboveFoorObj) {
                    //alert(this.imageMapAboveFoorObj[o][0] == (cursor[0]+x));
                    //alert(this.imageMapAboveFoorObj[o][1] == (cursor[1]+y));
                    //alert(this.imageMapAboveFoorObj[o][4] == parseInt(Core.Placeholder.zIndex*32,0));
                    if ((this.imageMapAboveFoorObj[o][0] == (cursor[0] + x)) && this.imageMapAboveFoorObj[o][1] == (cursor[1] + y) && this.imageMapAboveFoorObj[o][4] == parseInt(Core.Placeholder.zIndex * 32, 0)) {
                        return parseInt(o) + 1;
                    }
                }
                return false;
            }
        },
        Reset: function () {
            this.ResetSelectedTiles();
            //also resets map
            this.Map.Reset();
        },
        ResetSelectedTiles: function () {
            this.selectedTiles = [true];
        },
        AddNewSelectedTileSlot: function () {
            if ((this.selectedTiles.length == 0) || (this.selectedTiles[this.selectedTiles.length - 1] != true))
                this.selectedTiles.push(true);
        },
        DrawSelectedTiles: function () {
            try {
                if (this.selectedTiles.length > 0) {
                    for (var p in this.selectedTiles) {
                        if (this.selectedTiles[p] != true)
                            this.DrawPlaceholder(this.selectedTiles[p][0], this.selectedTiles[p][1], this.selectedTiles[p][2], this.selectedTiles[p][3], this.selectedTiles[p][4]);
                    }
                }
            } catch (err) {
                alert(err);
            }
        },
        /*
        *	Gets a new canvas context
        */
        DrawPlaceholder: function (layer, x, y, frameWidth, frameHeight) {
            //If there is a new empty selectedTile slot available, adds the values
            if ((this.selectedTiles.length > 0) && (this.selectedTiles[this.selectedTiles.length - 1] == true)) {
                this.selectedTiles[this.selectedTiles.length - 1] = [layer, x, y, frameWidth, frameHeight];
            }
            //Draws a red placeholder
            Core.Canvas.context[layer].strokeStyle = this.Map.canDraw == true ? "#00C900" : "#C90000";
            if (typeof this._internalPWA == 'undefined') {
                this._internalPWA = 0;
                this._internalPWADirectionUp = true;
            }
            else if (this._internalPWA > this.placeholderWidthAnim[1])
                this._internalPWADirectionUp = false;
            else if (this._internalPWA < this.placeholderWidthAnim[0])
                this._internalPWADirectionUp = true;
            this._internalPWA += (this._internalPWADirectionUp == true ? this.Utils.PlaceholderWidthAnimAmountCalculated() : -this.Utils.PlaceholderWidthAnimAmountCalculated());
            var _zIndex = -Core.Placeholder.zIndex * 32;
            Core.Canvas.context[layer].lineWidth = this._internalPWA;
            Core.Canvas.context[layer].lineCap = "round";
            Core.Canvas.context[layer].lineJoin = "round";
            Core.Canvas.context[layer].beginPath();
            Core.Canvas.context[layer].moveTo(x + (frameWidth / 2) - 32, frameHeight + y - 16 + _zIndex);
            Core.Canvas.context[layer].lineTo(x + (frameWidth / 2), frameHeight + y + _zIndex);
            Core.Canvas.context[layer].lineTo(x + (frameWidth / 2) + 32, frameHeight + y - 16 + _zIndex);
            Core.Canvas.context[layer].lineTo(x + (frameWidth / 2), frameHeight + y - 32 + _zIndex);
            Core.Canvas.context[layer].lineTo(x + (frameWidth / 2) - 32, frameHeight + y - 16 + _zIndex);
            if (_zIndex != 0) {
                Core.Canvas.context[layer].lineTo(x + (frameWidth / 2) - 32, frameHeight + y - 16);
                Core.Canvas.context[layer].lineTo(x + (frameWidth / 2), frameHeight + y);
                Core.Canvas.context[layer].lineTo(x + (frameWidth / 2) + 32, frameHeight + y - 16);
                Core.Canvas.context[layer].lineTo(x + (frameWidth / 2), frameHeight + y - 32);
                Core.Canvas.context[layer].lineTo(x + (frameWidth / 2) - 32, frameHeight + y - 16);
                Core.Canvas.context[layer].moveTo(x + (frameWidth / 2) + 32, frameHeight + y - 16);
                Core.Canvas.context[layer].lineTo(x + (frameWidth / 2) + 32, frameHeight + y - 16 + _zIndex);
            }
            Core.Canvas.context[layer].stroke();
        }
    },
