function __initCoreLibrary__()
{
	if(!Core)
	{
		return false;
	}
	else
	{
		Core.Canvas = CoreLibrary.Canvas;
		Core.ControlPanel = CoreLibrary.ControlPanel;
		Core.ViewPoint = CoreLibrary.ViewPoint;
		Core.Scene = CoreLibrary.Scene;
		Core.Placeholder = CoreLibrary.Placeholder;
		Core.SceneTools = CoreLibrary.SceneTools;
		Core.SpriteSheets = CoreLibrary.SpriteSheets;
	};
}